ICO_HEBILL = ''
ICO_YANGS = ''


class Image(He):
    def __init__(self, u, source: str):
        He.__init__(self, u)
        if source.endswith(".png"):
            with open(source, 'rb') as file:
                self.__x__['source'] = base64.b64encode(file.read()).decode('utf-8')
        else:
            self.__x__['source'] = source

    @property
    @parse_self_x_item_value()
    def source(self): return

    @property
    @parse_self_x_item_value_or_set_by_func()
    def bytes_io(self): return BytesIO(self.bites)

    @property
    @parse_self_x_item_value_or_set_by_func()
    def bites(self): return base64.b64decode(self.source.encode('utf-8'))

    ##########
    def output_pil_image_obj(self, width: int = None, height: int = None):
        from PIL import Image
        image = Image.open(self.bytes_io)
        if width: image = image.resize((width, height if height else width))
        return image

    def save_by_pil_image(self, file: str | BytesIO, width: int = None, height: int = None):
        self.output_pil_image_obj(width, height).save(file)

    def pil_icons(self, file: str = None, sizes: list | tuple = None):
        """
        :param file:
        :param sizes: (16, 24, 32, 48, 64, 128, 256)
        :return: 
        """
        sizes = sizes if sizes else (16, 24, 32, 48, 64, 128, 256)
        file = file if file else f'icon-{'-'.join(map(str, sizes))}.ico'
        image = self.output_pil_image_obj()
        image.save(file, format='ICO', sizes=[(size, size) for size in sizes])

    def save_as_pil_icons(self, file: str = None, sizes: list | tuple = None):
        """
        :param file:
        :param sizes: (16, 24, 32, 48, 64, 128, 256)
        :return: , 
        """
        sizes = sizes if sizes else (16, 24, 32, 48, 64, 128, 256)
        file = file if file else f'icon-{'-'.join(map(str, sizes))}.ico'
        image = self.output_pil_image_obj()
        image.save(file, format='ICO', sizes=[(size, size) for size in sizes])

    #  wx.Image
    def wx_image(self, width: int = None, height: int = None):
        import wx
        # noinspection PyTypeChecker
        image = wx.Image(self.bytes_io)
        if width:
            image = image.Scale(width, height if height else width, wx.IMAGE_QUALITY_HIGH)
        return image

    def save_as_wx_image(self, file: str | BytesIO = None, width: int = None, height: int = None):
        self.wx_image(width, height).SaveFile(file)

    #  wx.Bitmap
    def wx_bitmap(self, width: int = None, height: int = None):
        import wx
        # noinspection PyTypeChecker
        image = wx.Image(self.bytes_io, wx.BITMAP_TYPE_ANY)
        bitmap = wx.Bitmap(image)
        if width:
            image = bitmap.ConvertToImage().Scale(width, width if height is None else height, wx.IMAGE_QUALITY_HIGH)
        return wx.Bitmap(image)

    def save_as_wx_bitmap(self, file: str = None, width: int = None, height: int = None):
        import wx
        self.wx_bitmap(width, height).SaveFile(file, wx.BITMAP_TYPE_PNG)

    def wx_bitmap_io(self, width: int = None, height: int = None):
        import wx
        buffer = BytesIO()
        self.wx_bitmap(width, height).SaveFile(buffer, wx.BITMAP_TYPE_PNG)
        return buffer.getvalue()

    #  wx.Icon
    def wx_icon(self, size: int = None):
        import wx
        icon = wx.Icon()
        icon.CopyFromBitmap(self.wx_image(size if size else None).ConvertToBitmap())
        return icon

    def save_as_wx_icon(self, file: str = None, size: int = None):
        import wx
        image = self.wx_image(size)
        image.SaveFile(file if file else f'wx-icon-{image.GetWidth()}x{image.GetHeight()}', wx.BITMAP_TYPE_PNG)

    def wx_icons(self, sizes: list = None):
        sizes = sizes if sizes else (16, 24, 32, 48, 64, 128, 256)
        image = self.output_pil_image_obj()
        ico_data = BytesIO()
        image.save(ico_data, format='ICO', sizes=[(size, size) for size in sizes])
        #  wx.Image 
        import wx
        # noinspection PyTypeChecker
        wx_image = wx.Image(ico_data, type=wx.BITMAP_TYPE_ICO)
        #  wx.Icon 
        icon = wx.Icon()
        icon.CopyFromBitmap(wx_image.ConvertToBitmap())
        return icon


